🇺🇲🇬🇧
LIGHT & SUPPORTIVE 
The Cloudflyer uses twelve bigger and wider cloud elements which not only provide increased cushioning, but they provide improved support by creating a wider base. They are also configured with some softer cloud pods to reduce inward rotation when landing. The overall effect is a stable, but natural transition which is enhanced by the unique speedboard running the length of the shoe.

 

